    def is_valid(grammar, string):
        stack = []
        for token in string:
            if token.isalpha():
                stack.append(token)
            elif token == ' ':
                continue
            else:
                if not stack:
                    return False
                top = stack[-1]
                if top == ' ' or top in ['N', 'V', 'O', 'J', '?', '!', ']', ';']:
                    return False
                stack.pop()
        return not stack

    if is_valid(grammar, s):
        print("Yes")
    else:
        print("No")

